import './css/App.css';


function App() {
  return (
    <div>
        <nav>
          <span className='PostNav'>Create the post</span>
          <span className='PostNav'>All Posts</span>
          </nav>
        <div id='aboutApp'>
          this social app created developer from Ukraine his name are Artem Ivanov
        </div>
    </div>
  );
}

export default App;
